Вот Swift метод, который упорядочивает массив целых чисел с помощью функции `sort()` и затем отображает упорядоченный массив на экране:

```swift
import Foundation

// Метод для упорядочения и отображения массива целых чисел
func sortAndPrintArray(array: [Int]) {
    // Упорядочиваем массив
    let sortedArray = array.sorted()

    // Отображаем упорядоченный массив на экране
    print(sortedArray)
}

// Пример использования
let unsortedArray = [5, 2, 8, 1, 9]
sortAndPrintArray(array: unsortedArray)
```

Этот метод принимает массив целых чисел в качестве параметра, упорядочивает его с помощью функции `sorted()`, а затем отображает упорядоченный массив на консоль. Вы можете заменить `print(sortedArray)` на любой другой способ отображения, который соответствует вашим потребностям.

A continuación se muestra un script para ESP32 que utiliza el módulo OneWire para comunicarse con los sensores DS18B20 y la biblioteca Serial para mostrar la ubicación y la temperatura en la consola serial. Este script asume que has configurado correctamente el hardware, conectando los sensores DS18B20 a la entrada GPIO 2 (o cualquier pin que hayas elegido) y que has incluido los archivos necesarios (`OneWire.h`, `Wire.h` y `DS18B20.h`) en tu proyecto.

```cpp
#include <OneWire.h>
#include <DS18x20.h>
#include <Wire.h>

// Define el pin GPIO donde está conectado el bus OneWire
#define ONE_WIRE_PIN 2

// Array para almacenar los IDs de los sensores
#define NUM_DS18B20_ONESHOT_SENSORS 16
OneWire onesWire(ONE_WIRE_PIN);
DS18B20_OneWire ds( &onesWire );

// Array para almacenar los objetos de los sensores
DS18B20_OneWire_Sensor sensors[NUM_DS18B20_ONESHOT_SENSORS];

void setup() {
  Serial.begin(115200);
  Serial.println("Iniciando DS18B20...");

  // Inicializar los sensores
  for (int i = 0; i < NUM_DS18B20_ONESHOT_SENSORS; i++) {
    sensors[i].reset();
    sensors[i].select(i);
    sensors[i].beginOneShot();
  }

  Serial.println("DS18B20 inicializados correctamente.");
}

void loop() {
  Serial.print("Ubicación y temperatura de los sensores: ");

  for (int i = 0; i < NUM_DS18B20_ONESHOT_SENSORS; i++) {
    bool success = sensors[i].readTempC(true);

    if (success) {
      Serial.print(i);
      Serial.print(": ");
      Serial.print(sensors[i].getTempC());
      Serial.println("°C");
    } else {
      Serial.println("Error al leer el sensor " + String(i));
    }
  }

  delay(2000); // Esperar 2 segundos antes de leer nuevamente
}
```

Este script inicializa los sensores DS18B20 y luego lee y muestra la temperatura de cada sensor en la consola serial cada 2 segundos. La ubicación de cada sensor se indica por su índice en el array (0 a 15).

Asegúrate de ajustar el número de sensores (`NUM_DS18B20_ONESHOT_SENSORS`) según el número de sensores DS18B20 que tengas conectados al bus OneWire.

Recuerda compilar y probar tu código en un entorno de desarrollo basado en ESP32, como el Arduino IDE o PlatformIO, asegurándote de que tienes configurado correctamente el puerto serial y la velocidad de baudios.

A continuación se muestra un ejemplo de implementación del algoritmo de ordenación `bubble sort` en el lenguaje de programación C. El algoritmo `bubble sort` funciona recorriendo repetidamente la lista, comparando elementos adyacentes y intercambiándolos si están en el orden incorrecto. El proceso se repite hasta que la lista esté completamente ordenada.

```c
#include <stdio.h>

void bubbleSort(int arr[], int n) {
    int i, j, temp;

    for (i = 0; i < n - 1; i++) {
        // El último elemento en cada iteración ya está en su posición correcta
        for (j = 0; j < n - i - 1; j++) {
            // Si el elemento actual es mayor que el siguiente
            if (arr[j] > arr[j + 1]) {
                // Intercambiar los elementos
                temp = arr[j];
                arr[j] = arr[j + 1];
                arr[j + 1] = temp;
            }
        }
    }
}

void printArray(int arr[], int size) {
    int i;
    for (i = 0; i < size; i++)
        printf("%d ", arr[i]);
    printf("\n");
}

int main() {
    int arr[] = {64, 34, 25, 12, 22, 11, 90};
    int n = sizeof(arr) / sizeof(arr[0]);

    printf("Array antes de ordenar: \n");
    printArray(arr, n);

    bubbleSort(arr, n);

    printf("Array después de ordenar: \n");
    printArray(arr, n);

    return 0;
}
```

Este programa define una función `bubbleSort` que toma un arreglo de enteros y su tamaño como parámetros. Ordena el arreglo usando el algoritmo `bubble sort` y luego imprime el arreglo antes y después de la ordenación. La función `printArray` se utiliza para imprimir el contenido del arreglo.

Para probar el programa, crea un arreglo de enteros y llama a la función `bubbleSort`. Luego imprime el arreglo antes y después de la ordenación para verificar el resultado.

