A lógica "if" em Java é uma estrutura condicional usada para executar um bloco de código apenas se uma determinada condição for verdadeira. Ela é essencial para tomar decisões no código com base em condições variáveis.

Aqui está a sintaxe básica da declaração "if":

```java
if (condição) {
    // Bloco de código a ser executado se a condição for verdadeira
}
```

Veja como funciona:

1. **Condição**: A parte entre parênteses é uma expressão que avalia a verdade ou falsidade. Pode ser qualquer expressão que retorne um valor booleano (`true` ou `false`). Exemplos incluem comparações (`==`, `!=`, `<`, `>`, `<=`, `>=`), verificações de igualdade (`equals()`, `equalsIgnoreCase()`), verificações de presença (`contains()`, `indexOf()`), e outras.

2. **Bloco de código**: Se a condição for verdadeira, o compilador Java executa o bloco de código aninhado dentro dos sinais de abertura e fechamento `{}`. Se a condição for falsa, o bloco de código é ignorado.

Aqui está um exemplo simples:

```java
int numero = 10;

if (numero > 5) {
    System.out.println("O número é maior que 5.");
}
```

Neste exemplo, a condição `numero > 5` é verdadeira, então o programa imprimirá "O número é maior que 5."

Você também pode usar declarações "else" para lidar com o caso em que a condição é falsa:

```java
int numero = 2;

if (numero > 5) {
    System.out.println("O número é maior que 5.");
} else {
    System.out.println("O número não é maior que 5.");
}
```

Neste caso, como a condição `numero > 5` é falsa, o programa imprimirá "O número não é maior que 5."

Além disso, você pode usar declarações "else if" para verificar várias condições:

```java
int numero = 3;

if (numero > 5) {
    System.out.println("O número é maior que 5.");
} else if (numero < 5) {
    System.out.println("O número é menor que 5.");
} else {
    System.out.println("O número é exatamente 5.");
}
```

Neste exemplo, como `numero` é 3, a condição `numero > 5` é falsa, então o programa verifica a próxima condição `numero < 5`, que é verdadeira, então ele imprime "O número é menor que 5."

A lógica "if" é uma ferramenta fundamental em Java para tomar decisões condicionais no seu código.

